"use client";
import { Parser as o } from "./parsers.mjs";
import { Result as t } from "./result.mjs";
const s = (n) => new o((e) => new t(n, e)), u = (n, e) => n.chain((c) => e.map((r) => c.concat([r]))), p = (n) => n.reduce((e, c) => u(e, c), s([])), w = (n) => new o((e) => {
  let c = new t([], e);
  for (; !e.eof(); )
    c = c.concat(n.run(e));
  return c;
});
export {
  w as greedy,
  p as sequence
};
